re not allowed to access this font face.'=>'क्षमस्व, तुम्हाला हे फॉन्ट फेस एक्सेस करण्याची परवानगी नाही.','Sorry, you are not allowed to access font faces.'=>'क्षमस्व, तुम्हाला फॉन्ट फेसेस एक्सेस करण्याची परवानगी नाही.','Unique identifier for the font face.'=>'फॉन्ट फेसची अद्वितीय ओळख.','The ID for the parent font family of the font face.'=>'फॉन्ट फेसच्या पॅरेंट फॉन्ट फॅमिलीची आयडी.','Sorry, you are not allowed to access font collections.'=>'क्षमस्व, तुम्हाला फॉन्ट कलेक्शन्स एक्सेस करण्याची परवानगी नाही.','The categories for the font collection.'=>'फॉन्ट कलेक्शनसाठी श्रेण्या.','The font families for the font collection.'=>'फॉन्ट कलेक्शनसाठी फॉन्ट फॅमिलीज.','The description for the font collection.'=>'फॉन्ट कलेक्शनसाठी वर्णन.','The name for the font collection.'=>'फॉन्ट कलेक्शनसाठी नाव.','Unique identifier for the font collection.'=>'फॉन्ट कलेक्शनची अद्वितीय ओळख.','Font collection not found.'=>'फॉन्ट कलेक्शन सापडले नाही.','Allowed child block types.'=>'अनुमती असलेले चाइल्ड ब्लॉक प्रकार.','font categoryDisplay'=>'डिस्प्ले','Public facing script module IDs.'=>'सार्वजनिक मुखपृष्ठ स्क्रिप्ट मॉड्यूल IDs.','This site does not support post thumbnails on attachments with MIME type %s.'=>'या साइटवर MIME प्रकार %s असलेल्या अटॅचमेंट्सवर पोस्ट थंबनेल्सचा समर्थन नाही.','Font Face'=>'फॉन्ट फेस','Font Faces'=>'फॉन्ट फेसेस','Font Families'=>'फॉन्ट फॅमिलीज','Font collection "%s" not found.'=>'फॉन्ट कलेक्शन "%s" सापडले नाही.','Font collection with slug: "%s" is already registered.'=>'स्लगसह: "%s" असलेले फॉन्ट कलेक्शन आधीपासून नोंदणीकृत आहे.','Font collection "%1$s" has missing or empty property: "%2$s".'=>'फॉन्ट कलेक्शन "%1$s" मध्ये गहाळ किंवा रिकामे प्रॉपर्टी: "%2$s" आहे.','Error decoding the font collection data from the HTTP response JSON.'=>'HTTP प्रतिसाद JSON मधून फॉन्ट कलेक्शन डेटा डिकोडिंगमध्ये त्रुटी.','Error fetching the font collection data from "%s".'=>'"%s" वरून फॉन्ट कलेक्शन डेटा फेच करताना त्रुटी.','Error decoding the font collection JSON file contents.'=>'फॉन्ट कलेक्शन