िणारा कोणत्याही मिडिया अटॅचमेंटसाठी अस्तित्वात असलेल्या विशेष पृष्ठाचे पाहतो तेव्हा दाखविले जाते.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'पोस्ट टॅग आर्काइव दाखवतो. ह्या टेम्प्लेटचा वापर केला जाईल जेव्हा एक अधिक विशिष्ट टेम्प्लेट (उदा. टॅग: पिझ्झा) सापडत नसेल.','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'एक निश्चित तारीख येथे भेट दिल्यावर एक पोस्ट आर्काइव दाखवते (उदा., example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'कस्टम टॅक्सोनोमी आर्काइव दाखवते. कॅटेगरीज आणि टॅग्ससारख्या टॅक्सोनोमीच्या तर्फे, टॅक्सोनोमीस तर्फे तुम्ही गोष्टी वर्गीकरण करण्यासाठी वापरता येतात. उदाहरणार्थ: "कला" असं एक टॅक्सोनोमी असल्यास, "आधुनिक" आणि "18 व्या शतक" असे अनेक टर्म्स असू शकतात. हे टेम्पलेट एक अधिक विशिष्ट टेम्पलेट (उदा. टॅक्सोनोमी: कला) सापडल्यास त्याच्या अभावीत वापरले जाईल.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'पोस्टची कॅटेगरी आर्काइव दाखवते. हे टेम्पलेट तेवढ्यात तेवढा विशिष्ट टेम्पलेट (उदा. कॅटेगरी: पाककृती) सापडत नसेल तेव्हा फॉलबॅक म्हणून काम करेल.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'एकल लेखकाचे पोस्ट आर्काइव दाखवते. ह्या टेम्पलेटने एक अधिक विशिष्ट टेम्पलेट (उदा. लेखक: व्यवस्थापक) सापडल्यास तो उपयोगी होईल.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'एकल लेखक, कॅटेगरी, टॅग, टॅक्सोनोमी, कस्टम पोस्ट टाईप आणि तारीख यांसह एकल आर्काइव दाखवतो. हे टेम्पलेट त्या वेळेस वापरले जाईल जेव्हा अधिक विशिष्ट टेम्पलेट (उदा. कॅटेगरी किंवा टॅग) सापडत नसतील.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'जर त्या पृष्ठाला कस्टम टेम्प्लेट लागू केले गेले नसेल किंवा समर्पित टेम्प्लेट अस्तित्वात नसेल तर स्थिर पृष्ठ प्रदर्शित करते.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'तुमच्या वेबसाइटवर एकल पोस्ट प्रदर्शित करते, जोपर्यंत त्या पोस्टला कस्टम टेम्प्लेट लागू केले गेले नसेल किंवा समर्पित टेम्प्लेट अस्तित्वात नसेल.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'तुमच्या साईटचा होमपेज दर्शवितो, तो तुमच्या नवीनतम पोस्ट्स किंवा स्थिर पृष्ठ दर्शविण्यास ठरतो. फ्रंट पेज टेम्पलेट सर्व टेम्पलेट्सपेक्षा मुख्यत्व घेतो.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'वाचनी प्राधान्यानुसार, अद्यापत्तील पोस्ट असा तात्पुरता साईटच्या होमपेजवर वापरला जातो किंवा "पोस्ट पेज" म्हणून वाचनी सेटिंग्जच्या अंतर्गत निर्धारित केलेल्या प्रमाणे दर्शविला जातो. जर असेल तर, फ्रंट पेज टेम्पलेट हे टेम्पलेट हे जेव्हा पोस्ट्स होमपेजवर दाखविले जातात तेव्हा हे टेम्पलेट हे ओव्हरराइड करते.','Used as a fallback template for all pages when a more specific template is not defined.'=>'स्पष्टपणे प्रतिपादित नसल्यास, सर्व पृष्ठांसाठी एक पुनरावृत्ती टेम्पलेट म्हणून वापरले जाते.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'एकच एन्ट्री, उदा. एक पोस्ट किंवा पृष्ठ, दर्शविलेली जाते. ह्या टेम्पलेटने एक अधिक विशिष्ट टेम्पलेट (उदा