क्त एक वापरकर्तानाव तयार करा:','Site Domain (subdomain only):'=>'साइट डोमेन (फक्त उपडोमेन):','Site Name (subdirectory only):'=>'साइट नाव (फक्त उपनिर्देशिका):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'असे दिसते आहे की %s फाइल नाही. इंस्टॉलेशन सुरू होण्यापूर्वी ती आवश्यक आहे.','The date and time the preferences were updated.'=>'प्राधान्ये अद्यतनित केल्याची तारीख आणि वेळ.','Whether the theme disables generated layout styles.'=>'या थीमने उत्पन्न केलेल्या लेआउट स्टाइल अक्षम करते की नाही.','The icon for the post type.'=>'पोस्ट टाईपसाठीचा आयकॉन.','Whether a theme uses block-based template parts.'=>'एक थीम ब्लॉक-आधारित टेम्पलेट भागांचा उपयोग करते का.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store हे WP_Style_Engine_CSS_Rules_Store चे एक उदाहरण असणे आवश्यक आहे','Revisions not enabled.'=>'पुनरावलोकने सक्षम नाहीत.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'निर्मित टेम्पलेटसाठी टेम्पलेट प्रिफिक्स. हे मुख्य टेम्पलेट प्रकार काढण्यासाठी वापरले जाते, उदा. taxonomy-books मध्ये taxonomy काढले जाते','Indicates if a template is custom or part of the template hierarchy'=>'एक टेम्पलेट कस्टम आहे किंवा टेम्पलेट हायरार्कीचा भाग आहे हे दर्शविते','The slug of the template to get the fallback for'=>'बॅकअपसाठी टेम्पलेटचा स्लग','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'मूल्य जर स्ट्रिंग असेल तर मूल्याचा वापर संग्रह स्लग म्हणून केला जाईल. मूल्य जर खोटे असेल तर पोस्ट प्रकाराला कोणताही संग्रह नाही.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'पब्लिक फेसिंग आणि एडिटर स्टाइल हँडल. निवृत्त: style_handles चा उपयोग करा.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'एडिटर स्टाइल हँडल. निवृत्त: editor_style_handles चा उपयोग करा.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'पब्लिक फेसिंग स्क्रिप्ट हँडल. निवृत्त: view_script_handles चा उपयोग करा.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'पब्लिक फेसिंग आणि एडिटर स्क्रिप्ट हँडल. निवृत्त: script_handles चा उपयोग करा.','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'एडिटर स्क्रिप्ट हँडल. निवृत्त: editor_script_handles चा उपयोग करा.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'जर तुम्ही ह्या नेटवर्कचे मालक आहात तर कृपया तुमच्या होस्टच्या डेटाबेस सर्व्हरची योग्यपणे सुरू आहे आणि सर्व टेबल चुकशुद्ध आहेत ते तपासा.','An array of post types that the pattern is restricted to be used with.'=>'पॅटर्न वापरल्या जाणाऱ्या पोस्ट प्रकारांची अरे.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s हे अर्रेसचे अरे असावे. %2$s साठी नॉन-अरे मूल्य आढळले.','*'=>'*','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>%1$s आणि %2$s साठी विरोधाभासी मूल्ये.</strong> आपल्या उपडोमेन कॉन्फिगरेशन सेटिंग म्हणून %2$s चे मूल्य मानले जाईल.','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'आपण %1$s म्हणून लॉग इन आहात. <a href="%2$s">आपली प्रोफाईल संपादित करा</a>. <a href="%3$s">लॉग आउट?</a>','%sX-Large'=>'%sX-लार्ज','%sX-Small'=>'%sX-स्मॉल','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'आपल्या %1$s फाइलमध्ये %3$s या मार्गावरील डायनॅमिक मूल्य (%2$s) वापरले गेले आहे. परंतु, %3$s येथील मूल्यही एक डायनॅमिक मूल्य (%4$s कडे निर्देशित) आहे आणि दुसऱ्या डायनॅमिक मूल्याकडे निर्देशित करणे समर्थित नाही. कृपया %3$s ला थेट %4$s कडे निर्देशित करण्यासाठी अद्यतनित करा.','put your unique phrase here'=>'आपला अनोखा वाक्यांश इथे टाका','Cache key must be an integer or a non-empty string, %s given.'=>'कॅश की हे एक इंटिजर किंवा नॉन-एम्प्टी स्ट्रिंग असणे आवश्यक आहे, %s दिले गेले.','Cache key must not be an empty string.'=>'कॅश की रिकामी स्ट्रिंग असू नये.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'या वेबसाइटवर एक गंभीर चूक झाली आहे. कृपया आपल्या साइट व्यवस्थापकाशी संपर्क साधा, आणि या चुकीबद्दल अधिक मदतीसाठी त्यांना सूचित करा.','When checking for the %s capability, you must always check it against a specific user.'=>'%s क्षमतेची तपासणी करताना, आपण नेहमी एका विशिष्ट वापरकर्त्याविरुद्ध ती तपासणी करावी लागेल.','When checking for the %s capability, you must always check it against a specific term.'=>'%s क्षमतेची तपासणी करताना, आपण नेहमी एका विशिष्ट टर्मविरुद्ध ती तपासणी करावी लागेल.','When checking for the %s capability, you must always check it against a specific comment.'=>'%s क्षमतेची तपासणी करताना, आपण नेहमी एका विशिष्ट टिप्पणीविरुद्ध ती तपासणी करावी लागेल.','When checking for the %s capability, you must always check it against a specific page.'=>'%s क्षमतेची तपासणी करताना, आपण नेहमी एका विशिष्ट पृष्ठाविरुद्ध ती तपासणी करावी लागेल.','When checking for the %s capability, you must always check it against a specific post.'=>'%s क्षमतेची तपासणी करताना, आपण नेहमी एका विशिष्ट पोस्टविरुद्ध ती तपासणी करावी लागेल.','Your object cache implementation does not support flushing individual groups.'=>'आपल्या ऑब्जेक्ट कॅश कार्यान्वयनामध्ये वैयक्तिक गटांचे फ्लशिंग समर्थित नाही.','Deleted author: %s'=>'डिलीट केलेले लेखक: %s','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'आपल्या ऑब्जेक्ट कॅश कार्यान्वयनामध्ये मेमरीमध्ये रनटाइम कॅश फ्लशिंग समर्थित नाही.','Template for %s'=>'%s साठी टेम्पलेट','Not found: %1$s (%2$s)'=>'सापडले नाही: %1$s (%2$s)','Block pattern categoryFooters'=>'पायऱ्या','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'हुकसाठी क्रॉन अनस्केड्यूल इव्हेंट त्रुटी: %1$s, त्रुटी कोड: %2$s, त्रुटी संदेश: %3$s, डेटा: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'हुकसाठी क्रॉन रीशेड्यूल इव्हेंट त्रुटी: %1$s, त्रुटी कोड: %2$s, त्रुटी संदेश: %3$s, डेटा: %4$s','Whether a theme uses block-based templates.'=>'एक थीम ब्लॉक-आधारित टेम्पलेट्सचा उपयोग करते का.','What to show on the front page'=>'पहिल्या पृष्ठवर काय दाखवायचे','The ID of the page that should display the latest posts'=>'नवीनतम पोस्ट्स दाखविणार्या पृष्ठाचे आयडी','The ID of the page that should be displayed on the front page'=>'फ्रंट पेजवर प्रदर्शित केले जाणारे पृष्ठाचे आयडी','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%1$s फाइल आवृत्ती %2$s पासून <strong>निवृत्त</strong> झाली आहे आणि त्याचे कोणतेही पर्याय उपलब्ध नाहीत.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%1$s फाइल आवृत्ती %2$s पासून <strong>निवृत्त</strong> झाली आहे! %3$s चा उपयोग करा.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%1$s फंक्शन आवृत्ती %2$s पासून <strong>निवृत्त</strong> झाले आहे आणि त्याचे कोणतेही पर्याय उपलब्ध नाहीत.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%1$s फंक्शन आवृत्ती %2$s पासून <strong>निवृत्त</strong> झाले आहे! %3$s चा उपयोग करा.','block titleRead More'=>'पुढे वाचा','block descriptionDisplays the link of a post, page, or any other content-type.'=>'पोस्ट, पृष्ठ, किंवा कोणत्याही अन्य सामग्रीचा लिंक दर्शवितो.','block descriptionContains the block elements used to render content when no query results are found.'=>'क्वेरी नो रिझल्ट्स आढळल्यास वापरल्या जाणाऱ्या ब्लॉक घटकांचा समावेश असलेले ब्लॉक.','block titleNo Results'=>'नो रिजल्टस','block titleAuthor Biography'=>'लेखकाची जीवनचरित्रे','block descriptionThe author biography.'=>'पोस्ट लेखक चरित्र','block descriptionDisplay post author details such as name, avatar, and bio.'=>'पोस्ट लेखकाचे तपशील जसे की नाव, अवतार, आणि बायो दर्शवा.','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'साइटच्या होमपेजला नेहमी निर्देशित करणारी लिंक तयार करा. साधारणतः, हेडरमध्ये साइट शीर्षक लिंक असल्यास ही गरज नसते.','block titleHome Link'=>'होम लिंक','block descriptionGather blocks in a layout container.'=>'लेआउट कंटेनरमध्ये ब्लॉक्स गोळा करा.','block titleComments Title'=>'कमेंट्स शीर्षक','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'वेगवेगळ्या दृश्य कॉन्फिगरेशन्स वापरून पोस्ट कमेंट्स प्रदर्शित करण्यासाठी एक प्रगत ब्लॉक.','block descriptionDisplays a title with the number of comments.'=>'कमेंट्सची संख्या असलेले शीर्षक प्रदर्शित करते.','block descriptionDisplays the previous comment\'s page link.'=>'मागील टिप्पणीची पृष्ठ लिंक प्रदर्शित करते.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'योग्य असल्यास, पुढील/मागील टिप्पण्यांच्या पृष्ठभूमीवर पृष्ठवर्गीकरण दर्शवितो.','block titleComments Pagination'=>'कमेंट्स पेजिनेशन','block descriptionDisplays a list of page numbers for comments pagination.'=>'टिप्पणी पृष्ठांच्या पृष्ठभूमिकेसाठी पृष्ठांची यादी दर्शवितो.','block descriptionDisplays the next comment\'s page link.'=>'पुढील टिप्पणीचा पृष्ठ लिंक दर्शवितो.','block titleComment Template'=>'टिप्पणी टेम्पलेट','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'शीर्षक, तारीख, लेखक, अवतार आणि अधिक सारख्या ब्लॉक घटकांचा समावेश असलेले ब्लॉक जे एक कमेंट प्रदर्शित करण्यासाठी वापरले जातात.','block descriptionDisplays a link to reply to a comment.'=>'कमेंटला उत्तर देण्यासाठी एक लिंक प्रदर्शित करते.','block titleComment Reply Link'=>'कमेंट उत्तर लिंक','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'WordPress डॅशबोर्डमध्ये कमेंट संपादित करण्यासाठी एक लिंक प्रदर्शित करते. हा लिंक केवळ कमेंट संपादित करण्याची क्षमता असलेल्या वापरकर्त्यांनाच दिसतो.','block titleComment Edit Link'=>'कमेंट संपादित लिंक','block descriptionDisplays the date on which the comment was posted.'=>'कमेंट पोस्ट केलेल्या तारखेचे प्रदर्शन करते.','block descriptionDisplays the contents of a comment.'=>'कमेंटचे सामग्री प्रदर्शित करते.','block titleAvatar'=>'अवतार','block descriptionAdd a user’s avatar.'=>'वापरकर्त्याचा अवतार जोडा.','block descriptionDisplays the name of the author of the comment.'=>'कमेंटचे लेखकाचे नाव प्रदर्शित करते.','block titleComment Author Name'=>'कमेंट लेखकाचे नाव','A WordPress Commenter'=>'वर्डप्रेस टिप्पणीकर्ता','Responses to %s'=>'%s ला प्रतिसाद','Response to %s'=>'%s ला प्रतिसाद','block titleComment Date'=>'टिप्पणी तारीख','block titleComment Content'=>'टिप्पणी सामग्री','Default Avatar'=>'मुलभूत अवतार','Alignment optionNone'=>'काहीही नाही','There is already a ping from that URL for this post.'=>'ह्या पोस्टसाठी त्या URL वरील पिंग आधीपासूनच आहे.','The password cannot be a space or all spaces.'=>'पासवर्ड एक स्थान किंवा सर्व स्थाने असू शकत नाही.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'अधिक मदतीची गरज आहे? <a href="%1$s">%2$s वरील सहाय्य लेख वाचा</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'डेटाबेस सर्व्हरला जोडले जाऊ शकले (ज्याचा अर्थ तुमचे वापरकर्तानाव आणि पासवर्ड ठीक आहे) पण %s डेटाबेस निवडले जाऊ शकले नाही.','Cannot select database'=>'डेटाबेस निवडू शकत नाही','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'माफ करा, दिलेल्या URL वरील व्हिडीओ लोड केला जाऊ शकत नाही. कृपया तपासा की URL सपोर्ट केलेल्या व्हिडीओ फाईल (%s) किंवा स्ट्रीम (उदा. YouTube आणि Vimeo) आहे की नाही.','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ती फाईल सापडत नाही. तुमची <a href="%s">मीडिया लायब्ररी</a> तपासा आणि ती हटवली नाही याची खात्री करा.','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'तो व्हिडिओ सापडत नाही. तुमची <a href="%s">मीडिया लायब्ररी</a> तपासा आणि ती हटवली नाही याची खात्री करा.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ती प्रतिमा सापडत नाही. तुमची <a href="%s">मीडिया लायब्ररी</a> तपासा आणि ती हटवली नाही याची खात्री करा.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ती ऑडिओ फाइल सापडत नाही. तुमची <a href="%s">मीडिया लायब्ररी</a> तपासा आणि ती हटवली नाही याची खात्री करा.','User URL may not be longer than 100 characters.'=>'वापरकर्ता यूआरएल १०० अक्षरांपेक्षा लांब असू शकत नाही.','Unable to pass %s if not using multisite.'=>'मल्टीसाइट वापरत नसल्यास %s पास करू शकत नाही.','Webfont font weight must be a properly formatted string or integer.'=>'वेबफॉन्ट फॉन्ट वेट योग्यपणे स्वरुपित केलेला स्ट्रिंग किंवा पूर्णांक असणे आवश्यक आहे.','Each webfont src must be a non-empty string.'=>'प्रत्येक वेबफॉन्ट src रिक्त नसलेली स्ट्रिंग असणे आवश्यक आहे.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src ही रिक्त नसलेली स्ट्रिंग किंवा स्ट्रिंगची ॲरे असणे आवश्यक आहे.','Webfont font family must be a non-empty string.'=>'Webfont फॉन्ट कुटुंब रिक्त नसलेली स्ट्रिंग असणे आवश्यक आहे.','Limit results to those matching a pattern (slug).'=>'परिणामांची मर्यादा एक पॅटर्न (स्लग) संबंधित असलेल्या आहेत.','Ancestor blocks.'=>'पूर्वज ब्लॉक्स.','Determines whether the pattern is visible in inserter.'=>'इन्सर्टरमध्ये नमुना स्पष्ट आहे की नाही हे निर्धारित करते.','The pattern category slugs.'=>'पॅटर्न कॅटेगरी स्लग्स.','The pattern name.'=>'पॅटर्नचे नाव.','The category label, in human readable format.'=>'मानव वाचनीय स्वरूपातील कॅटेगरी लेबल.','Block types that the pattern is intended to be used with.'=>'पॅटर्न ज्या ब्लॉक प्रकारांसाठी वापरण्यात आला आहे ते.','The pattern viewport width for inserter preview.'=>'इन्सर्टर पूर्वावलोकनासाठी पॅटर्न व्यूपोर्ट रुंदी.','The pattern detailed description.'=>'पॅटर्नचे सविस्तर वर्णन.','Sorry, you are not allowed to view the registered block patterns.'=>'माफ करा, तुम्हाला नोंदणीकृत ब्लॉक पॅटर्न्स पाहण्याची परवानगी नाही.','The category name.'=>'श्रेणीचे नाव.','Sorry, you are not allowed to view the registered block pattern categories.'=>'माफ करा, तुम्हाला नोंदणीकृत ब्लॉक पॅटर्न श्रेणी पाहण्याची परवानगी नाही.','The pattern keywords.'=>'पॅटर्न कीवर्ड्स.','Error in deleting the attachment.'=>'अटॅचमेंट हटविण्यात त्रुटी.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>त्रुटी:</strong> हे वैध फीड टेम्पलेट नाही.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'जर सक्रिय थीम सपोर्ट करते असेल तर वर्तमान थीममध्ये वर्णन मेनूमध्ये दाखविला जाईल.','A title on that page cannot be found.'=>'त्या पृष्ठावरील शीर्षक सापडत नाही.','color schemeLight'=>'उजळ','color schemeDark'=>'गडद','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>चुक:</strong> थीम्स डायरेक्टरी अशी आहे की ती रिक्त आहे किंवा अस्तित्वात नाही. कृपया आपली स्थापना तपासा.','File does not exist?'=>'फाईल अस्तित्वात नाही?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'या साइटच्या मुख्यपृष्ठावर RSS फीड जोडणे समर्थित नाही, कारण ते आपल्या साइटला मंद करू शकते. दुसरा ब्लॉक, जसे की <strong>नवीनतम पोस्ट्स</strong> ब्लॉक, वापरुन साइटवरील पोस्ट्सची यादी तयार करण्याचा प्रयत्न करा.','Older Comments'=>'जुन्या प्रतिक्रिया','Newer Comments'=>'नव्या प्रतिक्रिया','Responses'=>'प्रतिसाद','Response'=>'प्रतिसाद','(%s website link, opens in a new tab)'=>'(%s वेबसाइट लिंक, नवीन टॅबमध्ये उघडतो)','%s Avatar'=>'%s अवतार','(%s author archive, opens in a new tab)'=>'(%s लेखक संग्रह, नवीन टॅबमध्ये उघडते)','Could not register file "%s" as a block pattern ("Title" field missing)'=>'"%s" फाइलला ब्लॉक पॅटर्न म्हणून नोंदवता आले नाही ("शीर्षक" क्षेत्र गहाळ)','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'"%1$s" फाइलला ब्लॉक पॅटर्न म्हणून नोंदवता आले नाही (अवैध स्लग "%2$s")','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'"%s" फाइलला ब्लॉक पॅटर्न म्हणून नोंदवता आले नाही ("स्लग" क्षेत्र गहाळ)','Block pattern categoryFeatured'=>'वैशिष्ट्यीकृत','Use Site Editor'=>'साइट संपादक वापरा','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'अभिनंदन! आपला थीम ब्लॉक्ससह साइट संपादनाला समर्थन देतो. <a href="%1$s">अधिक सांगा</a>. %2$s','Icon'=>'चिन्ह','Site icon.'=>'साइट चिन्ह.','Font size nameExtra Large'=>'जास्त मोठं','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'संग्रहण पाहताना श्रेणी, टॅग आणि सानुकूल वर्गीकरणाचे वर्णन प्रदर्शित करा.','block titleTerm Description'=>'टर्म वर्णन','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'तुमच्या साइटचे विविध जागतिक क्षेत्र संपादित करा, जसे की शीर्षलेख, तळटीप, साइडबार किंवा तुमचे स्वतःचे तयार करा.','block titleTemplate Part'=>'टेम्पलेट भाग','block descriptionCreate structured content in rows and columns to display information.'=>'माहिती प्रदर्शित करण्यासाठी पंक्ती आणि स्तंभांमध्ये संरचित सामग्री तयार करा.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'या साइटचे नाव प्रदर्शित करते. ब्लॉक अद्ययावत करा आणि तो वापरला जाईल तेथे बदल लागू होतील. हे ब्राउझरच्या शीर्षक बारमध्ये आणि शोध परिणामांमध्ये देखील दिसेल.','block titlePagination'=>'पृष्ठांकन','block titlePrevious Page'=>'मागील पान','block titlePage Numbers'=>'पृष्ठ क्रमांक','block titleNext Page'=>'पुढील पृष्ठ','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'वर्तमान पोस्टच्या शेजारी असलेली पुढील किंवा मागील पोस्ट लिंक प्रदर्शित करते.','block titlePost Navigation Link'=>'पोस्ट नेव्हिगेशन लिंक','block descriptionDisplay a post\'s comments form.'=>'पोस्टच्या टिप्पण्या प्रदर्शित करा.','block style labelPlain'=>'साधा','block descriptionShow a block pattern.'=>'ब्लॉक नमुना दाखवा.','block titlePattern'=>'नमुना','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ब्लॉक्सचा संग्रह जो अभ्यागतांना तुमच्या साइटभोवती फिरू देतो.','block titleNavigation'=>'नेव्हिगेशन','block descriptionAdd a submenu to your navigation.'=>'तुमच्या नेव्हिगेशनमध्ये सबमेनू जोडा.','block titleSubmenu'=>'सबमेनू','block descriptionAdd a page, link, or another item to your navigation.'=>'तुमच्या नेव्हिगेशनमध्ये पृष्ठ, लिंक किंवा अन्य आयटम जोडा.','block titleCustom Link'=>'सानुकूल दुवा','block titleComments Form'=>'टिप्पणी फॉर्म','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'प्रत्येक स्तंभात जोडलेल्या ब्लॉक्ससह, एकाधिक स्तंभांमध्ये सामग्री प्रदर्शित करा.','Preload valueNone'=>'काहीही नाही','No comments'=>'टिप्पण्या नाहीत.','Media item link optionNone'=>'काहीही नाही','Could not strip invalid text.'=>'अवैध मजकूर काढता आला नाही.','Could not retrieve table charset.'=>'अवैध मजकूर काढता आला नाही.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'वर्डप्रेस डेटाबेस त्रुटी: खालील फील्डसाठी मूल्यांवर प्रक्रिया करणे अयशस्वी झाले: %s. पुरवठा केलेली मूल्ये खूप मोठी असू शकतात किंवा अवैध डेटा असू शकते.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'वर्डप्रेस डेटाबेस त्रुटी: खालील फील्डसाठी मूल्यावर प्रक्रिया करणे अयशस्वी झाले: %s. पुरवलेले मूल्य खूप मोठे असू शकते किंवा त्यात अवैध डेटा असू शकतो.','WordPress database error: Could not perform query because it contains invalid data.'=>'वर्डप्रेस डेटाबेस त्रुटी: अवैध डेटा असल्यामुळे क्वेरी करणे संभव नव्हतं.','The description is not prominent by default; however, some themes may show it.'=>'वर्णन मूळतः प्रमुख नाही; मात्र, काही थीम्स ते दर्शवू शकतात.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'वंशवृक्ष तयार करण्यासाठी पालक टर्म नियुक्त करा. उदाहरणार्थ, जॅझ हे बेबॉप आणि बिग बँडचे पालक असेल.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" शैलीला नवीन विजेट्स संपादकासोबत (%2$s किंवा %3$s) एकत्रितपणे समाविष्ट करू नये.','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" स्क्रिप्टला नवीन विजेट्स संपादकासोबत (%2$s किंवा %3$s) एकत्रितपणे समाविष्ट करू नये.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'"स्लग" हे नावाचे URL-अनुकूल आवृत्ती आहे. सामान्यतः हे सर्व लहान अक्षरांमध्ये असते आणि फक्त अक्षरे, संख्या, आणि हायफन्स असतात.','The name is how it appears on your site.'=>'तुमच्या साइटवर ते कसे दिसते हे नाव आहे.','Template Part Areas'=>'टेम्पलेट पार्ट क्षेत्रे','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'सर्व्हर हे चित्र प्रक्रिया करू शकत नाही. हे सर्व्हर व्यस्त असल्यास किंवा कार्य पूर्ण करण्यासाठी पुरेसे संसाधने नसल्यास घडू शकते. लहान चित्र अपलोड केल्याने मदत होऊ शकते. सुचविलेले कमाल आकार 2560 पिक्सेल्स आहे.','Template Part Area'=>'टेम्प्लेट भाग क्षेत्र','Limit result set to users who have published posts.'=>'प्रकाशित पोस्ट्स असलेल्या वापरकर्त्यांच्या परिणाम समूहावर मर्यादा लावा.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'किमान एका विशिष्ट क्षमतेशी जुळणार्या वापरकर्त्यांच्या परिणाम समूहावर मर्यादा लावा. csv सूची किंवा एकल क्षमता स्वीकारतो.','Sorry, you are not allowed to filter users by capability.'=>'क्षमतेनुसार वापरकर्त्यांना फिल्टर करण्याची तुम्हाला परवानगी नाही.','Unable to retrieve body from response at this URL.'=>'या URL वरून प्रतिसादातून शरीर पुनर्प्राप्त करण्यात असमर्थ.','URL not found. Response returned a non-200 status code for this URL.'=>'URL सापडला नाही. प्रतिसादाने या URL साठी नॉन-200 स्थिती कोड परतविला.','Sorry, you are not allowed to process remote URLs.'=>'दूरस्थ URL प्रक्रिया करण्याची तुम्हाला परवानगी नाही.','Invalid URL'=>'अवैध URL','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'URL मधील %1$s किंवा %2$s घटकाची ओपन ग्राफ इमेज लिंक.','The content of the %s element from the URL.'=>'URL मधील %s घटकाचे सामग्री.','The favicon image link of the %s element from the URL.'=>'URL मधील %s घटकाच्या फेव्हिकॉन इमेज लिंक.','The contents of the %s element from the URL.'=>'URL मधील %s घटकाचे सामग्री.','The URL to process.'=>'प्रक्रिया करण्यासाठी URL.','Where the template part is intended for use (header, footer, etc.)'=>'टेम्पलेट भाग कोठे वापरासाठी इच्छित आहे (हेडर, फूटर, इत्यादी)','Whether a template is a custom template.'=>'एक टेम्पलेट कस्टम टेम्पलेट आहे का.','The ID for the author of the template.'=>'टेम्पलेटच्या लेखकाचा ID.','HTML title for the template, transformed for display.'=>'टेम्पलेटसाठी HTML शीर्षक, प्रदर्शनासाठी रूपांतरित.','Title for the template, as it exists in the database.'=>'डेटाबेसमध्ये अस्तित्वात असलेले टेम्पलेटचे शीर्षक.','Version of the content block format used by the template.'=>'टेम्पलेटद्वारे वापरल्या जाणार्या कंटेंट ब्लॉक स्वरूपाचे आवृत्ती.','Content for the template, as it exists in the database.'=>'डेटाबेसमध्ये अस्तित्वात असलेले टेम्पलेटसाठी सामग्री.','Source of a customized template'=>'कस्टमाइज केलेल्या टेम्पलेटचा स्रोत.','Type of template.'=>'टेम्पलेटचा प्रकार.','Post type to get the templates for.'=>'टेम्पलेट्स मिळविण्यासाठी पोस्ट प्रकार.','Limit to the specified template part area.'=>'निर्दिष्ट टेम्पलेट भाग क्षेत्रापर्यंत मर्यादित.','REST namespace route for the taxonomy.'=>'टॅक्सोनॉमीसाठी REST नेमस्पेस मार्ग.','Whether to make the post type available for selection in navigation menus.'=>'नेव्हिगेशन मेनूमध्ये निवडीसाठी पोस्ट प्रकार उपलब्ध करून देण्याची परवानगी आहे का.','Whether to generate a default UI for managing this post type.'=>'या पोस्ट प्रकाराचे व्यवस्थापन करण्यासाठी डिफॉल्ट UI निर्माण करण्याची परवानगी आहे का.','The visibility settings for the post type.'=>'पोस्ट प्रकारासाठी दृश्यता सेटिंग्ज.','REST route\'s namespace for the post type.'=>'पोस्ट प्रकारासाठी REST मार्गाचे नेमस्पेस.','Whether to automatically add top level pages to this menu.'=>'या मेनूमध्ये आपोआप टॉप लेव्हल पृष्ठे जोडण्याची परवानगी आहे का.','The locations assigned to the menu.'=>'मेनूला नियुक्त केलेल्या स्थाने.','The menu cannot be deleted.'=>'मेनू हटविला जाऊ शकत नाही.','Menus do not support trashing. Set \'%s\' to delete.'=>'मेनू ट्रॅशिंगला समर्थन देत नाहीत. हटविण्यासाठी \'%s\' सेट करा.','Sorry, you are not allowed to view menus.'=>'माफ करा, तुम्हाला मेनू पाहण्याची परवानगी नाही.','The ID of the assigned menu.'=>'नियुक्त केलेल्या मेनूचा ID.','The description of the menu location.'=>'मेनू स्थानाचे वर्णन.','The name of the menu location.'=>'मेनू स्थानाचे नाव.','Invalid menu location.'=>'अवैध मेनू स्थान.','Sorry, you are not allowed to view menu locations.'=>'माफ करा, तुम्हाला मेनू स्थाने पाहण्याची परवानगी नाही.','An alphanumeric identifier for the menu location.'=>'मेनू स्थानासाठी अल्फान्यूमेरिक ओळख.','The terms assigned to the object in the %s taxonomy.'=>'%s टॅक्सोनॉमीमध्ये ऑब्जेक्टला नियुक्त केलेल्या टर्म्स.','Whether the menu item represents an object that no longer exists.'=>'मेनू आयटम हा अस्तित्वात नसलेल्या ऑब्जेक्टला प्रतिनिधित्व करतो का.','The XFN relationship expressed in the link of this menu item.'=>'या मेनू आयटमच्या लिंकमध्ये व्यक्त केलेले XFN नाते.','The URL to which this menu item points.'=>'या मेनू आयटमने निर्देशित केलेला URL.','The singular label used to describe this type of menu item.'=>'या प्रकारच्या मेनू आयटमला वर्णन करण्यासाठी वापरलेला एकवचनी लेबल.','The target attribute of the link element for this menu item.'=>'या मेनू आयटमसाठी लिंक घटकाच्या लक्ष्य गुणधर्माचे.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'या मेनू आयटमने प्रतिनिधित्व केलेल्या मूळ ऑब्जेक्टचा डेटाबेस ID, उदाहरणार्थ पोस्टसाठी ID किंवा श्रेणीसाठी term_id.','The type of object originally represented, such as "category", "post", or "attachment".'=>'मूळत: प्रतिनिधित्व केलेल्या ऑब्जेक्टचा प्रकार, जसे की "श्रेणी", "पोस्ट", किंवा "अटॅचमेंट".','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'या आयटमच्या मेनू पालकाचा nav_menu_item चा DB ID, जर काही असेल तर, अन्यथा 0.','The description of this menu item.'=>'या मेनू आयटमचे वर्णन.','Class names for the link element of this menu item.'=>'या मेनू आयटमच्या लिंक घटकासाठी क्लास नावे.','Text for the title attribute of the link element for this menu item.'=>'या मेनू आयटमसाठी लिंक घटकाच्या शीर्षक गुणधर्मासाठी मजकूर.','The ID for the parent of the object.'=>'ऑब्जेक्टच्या पालकाचा ID.','A named status for the object.'=>'ऑब्जेक्टसाठी नामित स्थिती.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'मूळत: प्रतिनिधित्व केलेल्या ऑब्जेक्टचे कुटुंब, जसे की "post_type" किंवा "taxonomy".','HTML title for the object, transformed for display.'=>'ऑब्जेक्टसाठी HTML शीर्षक, प्रदर्शनासाठी रूपांतरित.','Title for the object, as it exists 