WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'कसे!

वर्डप्रेस 5.2 मध्ये एक अंगभूत वैशिष्ट्य आहे जे जेव्हा प्लगइन किंवा थीम आपल्या साइटवर गंभीर त्रुटी आणते तेव्हा शोधते आणि या स्वयंचलित ईमेलसह आपल्याला सूचित करते.
###CAUSE###
प्रथम, आपल्या वेबसाइटला भेट द्या (###SITEURL###) आणि कोणत्याही दृश्यमान समस्यांसाठी तपासणी करा. पुढे, ज्या पृष्ठास त्रुटी सापडली त्या पृष्ठास भेट द्या (###PAGEURL###) आणि कोणत्याही दृश्यमान समस्यांसाठी तपासणी करा.

###SUPPORT###

जर आपली साइट तुटलेली दिसत असेल आणि आपण आपल्या डॅशबोर्डवर सामान्यत: प्रवेश करू शकत नसाल तर वर्डप्रेसकडे आता एक विशेष "पुनर्प्राप्ती मोड" आहे. हे आपल्याला आपल्या डॅशबोर्डवर सुरक्षितपणे लॉग इन करू देते आणि पुढील चौकशी करू देते.

###LINK###

आपली साइट सुरक्षित ठेवण्यासाठी, हा दुवा ###EXPIRES### मध्ये कालबाह्य होईल. त्याबद्दल काळजी करू नका, तथापि: त्रुटी संपल्यानंतर पुन्हा त्रुटी आढळल्यास आपल्यास एक नवीन दुवा ईमेल केला जाईल.

या समस्येची मदत घेताना, आपल्याला पुढीलपैकी काही माहिती विचारली जाईल:
###DEBUG###

###DETAILS###','Please contact your host for assistance with investigating this issue further.'=>'या समस्येची पुढील तपासणीसाठी कृपया आपल्या होस्टशी संपर्क साधा.','Error occurred on a non-protected endpoint.'=>'असंरक्षित एंडपॉईंटवर त्रुटी आढळली आहे.','Recovery Mode &#8212; %s'=>'रिकव्हरी मोड &#8212; %s','[%s] Login Details'=>'[%s] लॉगिन तपशील','Move to Trash'=>'डिलिट करा ','Restore from Trash'=>'रिस्टोर करा ','https://wordpress.org/support/forums/'=>'https://wordpress.org/support/forums/','Support'=>'सहाय्य','[%s] Network Admin Email Change Request'=>'[%s] नेटवर्क ऍडमिन ईमेल बदलण्याची विनंती','[%s] Admin Email Changed'=>'[%s] ऍडमिन ईमेल बदलला गेला ','[%s] Network Admin Email Changed'=>'[%s] नेटवर्क ऍडमिन ईमेल बदलला गेला ','[%s] Email Change Request'=>'[%s] ईमेल बदलण्याची विनंती','[%s] Email Changed'=>'[%s] ईमेल बदलला गेला ','A calendar of your site’s posts.'=>'आपल्या साइटच्या पोस्ट्सचे कॅलेंडर','Edit gallery'=>'गॅलरी संपादित करा','Custom Colors'=>'सानुकूल रंग','Failed to store the error.'=>'त्रुटी साठवण्यास अयशस्वी.','Failed to exit recovery mode. Please try again later.'=>'पुनर्प्राप्ती मोडमधून बाहेर पडण्यात अयशस्वी. कृपया पुन्हा प्रयत्न करा.','Exit recovery mode link expired.'=>'पुनर्प्राप्ती मोड लिंकमधून निर्गमन कालबाह्य झाले.','Error not caused by a plugin or theme.'=>'प्लगइन किंवा थीममुळे त्रुटी आली नाही.','[%s] Your Site is Experiencing a Technical Issue'=>'[%s] आपली साइट एक तांत्रिक समस्या अनुभवत आहे','Recovery Mode not initialized.'=>'पुनर्प्राप्ती मोड प्रारंभ झाला नाही.','User roleSubscriber'=>'सदस्य','User roleContributor'=>'योगदानकर्ता','User roleAuthor'=>'लेखक','User roleEditor'=>'संपादक','User roleAdministrator'=>'प्रशासक','An incomplete personal data request for this email address already exists.'=>'या ईमेल ऍड्रेससाठी अपूर्ण विनंती आधीच अस्तित्वात आहे.','Error Details'=>'त्रुटी तपशील','Could not update the email last sent time.'=>'अंतिम पाठविलेले ईमेल अद्यतनित करू शकलो नाही.','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'एक पुनर्प्राप्ती लिंक आधीपासूनच %1$s पूर्वी पाठविली गेली होती. कृपया नवीन ईमेलची विनंती करण्यापूर्वी आणखी %2$s प्रतीक्षा करा.','Invalid recovery key format.'=>'अवैध पुनर्प्राप्ती की स्वरूप.','Invalid recovery key.'=>'अवैध पुनर्प्राप्ती की.','Recovery key expired.'=>'पुनर्प्राप्ती की कालबाह्य झाली आहे.','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'ईमेल पाठविला जाऊ शकला नाही. संभाव्य कारणः आपल्या होस्टने %s कार्य अक्षम केले असेल.','Select Site Icon'=>'साइट आयकॉन निवडा','Keep widget settings and move it to the inactive widgets'=>'विजेट सेटिंग्ज ठेवा आणि त्यास निष्क्रिय विजेटमध्ये हलवा','No cookie present.'=>'कुकी उपस्थित नाही.','Additional images added to this gallery: %s'=>'अतिरिक्त इमेजेस ह्या गॅलरीत जोडल्या: %s','Exit Recovery Mode'=>'पुनर्प्राप्ती मोडमधून बाहेर पडा','Cookie expired.'=>'कुकी कालबाह्य.','Invalid cookie.'=>'अवैध कुकी.','Invalid cookie format.'=>'अवैध कुकी स्वरूप.','Recovery Mode Initialized. Please log in to continue.'=>'पुनर्प्राप्ती मोड आरंभिक. कृपया सुरू ठेवण्यासाठी लॉग इन करा.','Missing request ID.'=>'गहाळ विनंती आयडी.','%s Comment in moderation'=>'%s टिप्पणी नियंत्रणात आहे' . "\0" . '%s टिप्पण्या नियंत्रणात आहेत','Quote from Hello Dolly song, by Jerry Herman:'=>'जेरी हर्मन यांनी हॅलो डॉली गाण्यावरून, उद्धृत केले आहे','The current image has no alternative text. The file name is: %s'=>'वर्तमान प्रतिमेत कोणताही वैकल्पिक मजकूर नाही. फाइलचे नावः%s आहे','Missing confirm key.'=>'गहाळ पुष्टीकरण की.','https://developer.wordpress.org/themes/advanced-topics/child-themes/'=>'https://developer.wordpress.org/themes/advanced-topics/child-themes/','An error of type %1$s was caused in line %2$s of the file %3$s. Error message: %4$s'=>'%1$s टाईपची एरर %3$s फाईलमध्ये %2$s लाईनमध्ये झाली आहे. एरर मेसेज: %4$s','Usage of the title attribute on the login logo is not recommended for accessibility reasons. Use the link text instead.'=>'सुलभतेच्या कारणास्तव लॉगिन लोगोवरील शीर्षक विशेषता वापरण्