र करण्याची आवश्यकता आहे. एक होमपेज होईल आणि दुसरे असे असतील जेथे आपली पोस्ट्स दाखवले जातील.','Homepage Settings'=>'मुख्यपृष्ठ सेटिंग्ज','Changes trashed successfully.'=>'बदल यशस्वीरित्या कचर्यात टाकले.','Changes have already been trashed.'=>'बदल आधीपासूनच कचर्यात टाकले गेले आहेत.','Unable to trash changes.'=>'बदल कचर्यात करण्यात अक्षम.','No changes saved yet, so there is nothing to trash.'=>'कोणतेही बदल अद्याप जतन केले नाहीत, त्यामुळे कचरापेटीत काहीच नाही.','There was an authentication problem. Please reload and try again.'=>'तिथे प्रमाणीकरण समस्या होती. कृपया रीलोड करा आणि पुन्हा प्रयत्न करा.','You must supply a future date to schedule.'=>'आपण शेड्यूल करण्यासाठी भविष्यातील तारीख प्रदान करणे आवश्यक आहे.','WordPress.org themes'=>'WordPress.org थीम्स','Publish Settings'=>'सेटिंग्ज प्रकाशित करा','Copied'=>'कॉपी केले','Preview Link'=>'पूर्वावलोकन दुवा','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'आपल्या वेबसाइटवर बदल कसे दिसेल ते पहा आणि कस्टोमिझेरमध्ये प्रवेश न करणाऱ्या लोकांना प्रदर्शन पाठवा.','Installed themes'=>'स्थापित थीम','Share Preview Link'=>'पूर्वावलोकन दुवा सामायिक करा','Unable to save due to %s invalid setting.'=>'%s अवैध सेटिंग्जमुळे जतन करण्यात अक्षम.' . "\0" . '%s अवैध सेटिंग्जमुळे जतन करण्यात अक्षम.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'बदलांचा मागील संच आधीपासून प्रकाशित केला गेला आहे. कृपया आपले वर्तमान संच जतन करण्याचे पुन्हा प्रयत्न करा.','Edit User'=>'एडीट वापरकर्ता','View User'=>'वापरकर्ता पहा','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'हा विजेट “कस्टम HTML” विजेटमध्ये अधिक चांगले काम करणारा कोड असू शकतो. आपण अजूनही प्रयत्न केला नसेल, तर त्या विजेटचा प्रयत्न कसा वाटतो?','Did you just paste HTML?'=>'आपण फक्त HTML पेस्ट केले का?','Did you know there is a &#8220;Custom HTML&#8221; widge