$s must be greater than or equal to %2$d'=>'%1$s, %2$d या पेक्षा मोठे किंवा समान असणे आवश्यक आहे','%1$s must be greater than %2$d'=>'%1$s, %2$d पेक्षा जास्त असणे आवश्यक आहे','Limit result set to users with one or more specific slugs.'=>'निकाल-सेट ला एक किंवा अधिक विशिष्ट स्लग असलेल्या वापरकरत्यांपर्यंत मर्यादित करा.','The password for the parent post of the comment (if the post is password protected).'=>'टिप्पणीच्या मूळ पोस्टसाठीचा पासवर्ड (जर ती पोस्ट पासवर्ड ने संरक्षित असेल तर)','pageUse as featured image'=>'वैशिष्ट्यपूर्ण इमेज म्हणून वापरा','postUse as featured image'=>'वैशिष्ट्यपूर्ण इमेज म्हणून वापरा','pageRemove featured image'=>'वैशिष्ट्यपूर्ण इमेज काढून टाका','postRemove featured image'=>'वैशिष्ट्यपूर्ण इमेज काढून टाका','pageSet featured image'=>'वैशिष्ट्यपूर्ण इमेज लावा','postSet featured image'=>'वैशिष्ट्यपूर्ण इमेज लावा','%1$s is deprecated. The callback from %2$s is used instead.'=>'%1$s असमर्थित झाले आहे. त्याऐवजी %2$s कडून कॉलबॅक वापरला आहे.','pageFeatured image'=>'वैशिष्ट्यपूर्ण इमेज','postFeatured image'=>'वैशिष्ट्यपूर्ण इमेज','You are about to permanently delete these items from your site.
