age, which is what most visitors will see when they come to your site for the first time.'=>'तुमच्या साईटवर तुमचं स्वागत आहे! हे तुमचे मुख्यपृष्ठ आहे, पहिल्यांदा तुमच्या साईटवर येणाऱ्या बहुतांश वाचकांना हेच पान सर्वात जास्त वेळा दिसणार आहे. ','Theme starter contentRecent Posts'=>'नवीन लेख','Theme starter contentRecent Comments'=>'नवीन टिप्पण्या','Theme starter contentMeta'=>'\'मेटा\'','Theme starter contentCalendar'=>'दिनदर्शिका','Sorry, you are not allowed to change the comment type.'=>'क्षमस्व, तुम्हाला टिप्पणीचा प्रकार बदलण्याची परवानगी नाही.','Sorry, you are not allowed to order users by this parameter.'=>'क्षमस्व, तुम्हाला या घटकांद्वारे क्रम लावण्यास परवानगी नाही.','Sorry, you are not allowed to filter users by role.'=>'क्षमस्व, तुम्हाला या पात्रांनुसार फिल्टर करण्याची परवानगी नाही.','Sorry, you are not allowed to give users that role.'=>'क्षमस्व, आपल्याला वापरकर्त्यांना ती भूमिका देण्याची अनुमती नाही','Sorry, you are not allowed to delete this comment.'=>'क्षमस्व, तुम्हाला ही टिप्पणी काढून टाकण्याची परवानगी नाही.','Sorry, you are not allowed to view revisions of this post.'=>'क्षमस्व, तुम्हाला या लेखाची आवृत्ती पाहण्यास परवानगी नाही.','Sorry, you are not allowed to create a comment on this post.'=>'क्षमस्व, तुम्हाला या लेखावर टिप्पणी करण्याची परवानगी नाही.','Sorry, you are not allowed to create this comment without a post.'=>'क्षमस्व, तुम्हाला लेखाशिवाय ही टिप्पणी करण्याची परवानगी नाही.','Sorry, you are not allowed to edit \'%s\' for comments.'=>'क्षमस्व, तुम्हाला टिप्पणीसाठी \'%s\' संपादन करण्याची परवानगी नाही.','Sorry, you are not allowed to read the post for this comment.'=>'क्षमस्व, तुम्हाला या टिप्पणीशी निगडीत लेख वाचण्याची परवानगी नाही.','Sorry, you are not allowed to read this comment.'=>'क्षमस्व, तुम्हाला ही टिप्पणी वाचण्याची परवानगी नाही.','Sorry, you are not allowed to view menu items.'=>'माफ करा, आपल्याला मेनूचे आयटम पाहायला परवानगी नाही.','Sorry, you are not allowed to read comments without a post.'=>'क्षमस्व, तुम्हाला लेखाशिवाय टिप्पण्या वाचण