ent for the post, as it exists in the database.'=>'पोस्टसाठी सामग्री, जसे डेटाबेसमध्ये अस्तित्वात आहे.','The content for the post.'=>'पोस्टसाठी सामग्री.','Unique identifier for the object.'=>'ऑब्जेक्ट अद्वितीय अभिज्ञापक','The comment cannot be deleted.'=>'टिप्पणी हटविली जाऊ शकत नाही.','The comment has already been trashed.'=>'टिप्पणी आधीपासूनच काढून टाकलेली आहे.','The ID of the user object, if author was a user.'=>'वापरकर्ता ऑब्जेक्टचा आयडी, जर लेखक वापरकर्ता आहे.','Invalid comment author ID.'=>'अवैध टिप्पणी लेखक आयडी.','User agent for the comment author.'=>'टिप्पणी लेखकासाठी युजर एजंट.','URL for the comment author.'=>'टिप्पणी लेखकासाठी URL.','Display name for the comment author.'=>'टिप्पणी लेखकासाठी प्रदर्शित नाव.','IP address for the comment author.'=>'टिप्पणी लेखकासाठी IP पत्ता.','Email address for the comment author.'=>'टिप्पणी लेखकासाठी ईमेल पत्ता.','Updating comment failed.'=>'टिप्पणी अद्यतन अयशस्वी.','Updating comment status failed.'=>'टिप्पणी स्थिती अद्यतन अयशस्वी.','Creating a comment requires valid author name and email values.'=>'कंमेंट तयार करण्यासाटी, एक वैध नाव ईमेल आयडी  आवश्यक आहे.','Creating comment failed.'=>'टिप्पणी तयार करणे अयशस्वी झाले.','Cannot create existing comment.'=>'विद्यमान टिप्पणी तयार करू शकत नाही.','Sorry, you must be logged in to comment.'=>'क्षमस्व, टिप्पणी आपण लॉग इन केलेले असणे आवश्यक आहे.','Query parameter not permitted: %s'=>'क्वेरी पॅरामीटर ला  %s ची परवानगी  नाही ','No data supplied.'=>'कोणताही डेटा पुरवला नाही','Limit result set to attachments of a particular MIME type.'=>'विशिष्ट एमआयएमइ (MIME ) टाईप अट्टाचमेंट्स साठी मर्यादित रिझल्ट सेट आहे ','Limit result set to attachments of a particular media type.'=>'विशिष्ट  मिडिया टाईप अट्टाचमेंट्स साठी  मर्यादित रिझल्ट सेट आहे.','Content hash did not match expected.'=>'अपेक्षित कन्टेन्ट हॅश मॅच नव्हते.','No Content-Type supplied.'=>'कन्टेन्ट-टाईप सप्लाय केले नव्हते.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png